【良退就是不还钱？】近日，玖富出借人收到北京市房山区阎村派出所白纸黑字加盖公章的回复:“玖富是北京市政府确定的良性退出平台”。但从2020年至今，近4年来，出借人没有从玖富拿到返还款！出借人向北京市民热线12345、北京市信访局、北京市政府信息公开等地方发出问询：1、北京市P2P良退标准是什么？2、 玖富为性良退出平台的文件要公示。但是，上述机构均不予回复，难道是阎村派出所在编造谎言吗？于是，很多出借人向新华社发电子邮件，请新华社派记者客观的采访北京市政府，北京市公安局和地方金融监督管理局等单位，真相究竟是什么？
